import { useState } from 'react';

// Define square component
function Square() {
  return <button className="square"></button>
}

// Use 'export' to make function accessible outside of this file
export default function Board() {
  // Create Component
  return (
    <>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>

      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>

      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
